import React from "react";
import { NavbarWrap } from "../../styles/components/Dashboard/NavbarStyle";
import {
  AiOutlineMenu,
  AiFillHome,
  AiFillDatabase,
  AiTwotoneFire,
  AiTwotoneSetting
} from "react-icons/ai";

export default function Navbar() {
  return (
    <NavbarWrap>
      <AiOutlineMenu />
      <AiFillHome />
      <AiTwotoneFire />
      <AiFillDatabase />
    </NavbarWrap>
  );
}
